import axios from "axios";
import store from "../../index";
import alliances from "../../reducers/alliances";

const addTeamToAllianceApi = async (team, alliance) => {
  console.log(team);
  console.log(alliance);
  const team_url = `http://cms.avertra.com/teams/${team.id}`;
  console.log(store.getState().token, "Tokennnnnnnnn");
  console.log(team_url);
  var data = JSON.stringify({
    alliance: "615963a462b183a56be98afc",
  });

  var config = {
    method: "put",
    url: "http://cms.avertra.com/teams/615da04662b183a56be98b33",
    headers: {
      Authorization:
        "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYxNTJiNmU1OTExZjZiYzY3MmQzZDZmNSIsImlhdCI6MTYzMjgzOTE1MCwiZXhwIjoxNjM1NDMxMTUwfQ.XEAwacR7yXCLA01xqXdnxTYuGWbEXGaICpUwrg2uZcE",
      "Content-Type": "application/json",
    },
    data: data,
  };

  axios(config)
    .then(function (response) {
      console.log(JSON.stringify(response.data));
    })
    .catch(function (error) {
      console.log(error);
    });
};
export { addTeamToAllianceApi };
